import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';
import { useAuth } from '../services/AuthContext';
import api from '../services/api';

const Dashboard = () => {
  const { user } = useAuth();
  const navigate = useNavigate();
  const [activeRental, setActiveRental] = useState(null);
  const [rentalHistory, setRentalHistory] = useState([]);

  useEffect(() => {
    fetchActiveRental();
    fetchRentalHistory();
  }, []);

  const fetchActiveRental = async () => {
    try {
      const response = await api.get('/rentals/active');
      setActiveRental(response.data);
    } catch (error) {
      console.log('No active rental');
    }
  };

  const fetchRentalHistory = async () => {
    try {
      const response = await api.get('/rentals/history');
      setRentalHistory(response.data);
    } catch (error) {
      console.error('Failed to fetch rental history');
    }
  };

  const needsDeposit = !user?.depositMade;

  return (
    <div>
      <Navbar />
      <div className="container">
        <div className="card">
          <h2 style={{ marginBottom: '20px', color: '#1f2937' }}>
            Welcome back! üëã
          </h2>

          {needsDeposit && (
            <div style={{ 
              background: '#fef3c7', 
              border: '1px solid #f59e0b', 
              borderRadius: '8px', 
              padding: '16px', 
              marginBottom: '20px' 
            }}>
              <h3 style={{ color: '#92400e', marginBottom: '8px' }}>‚ö†Ô∏è Deposit Required</h3>
              <p style={{ color: '#92400e', marginBottom: '12px' }}>
                Please deposit ‚Çπ300 to start renting umbrellas. You'll get ‚Çπ100 cashback instantly!
              </p>
              <button 
                className="btn btn-primary"
                onClick={() => navigate('/wallet')}
              >
                Make Deposit
              </button>
            </div>
          )}

          <div className="grid grid-2">
            <div className="card" style={{ background: '#f0f9ff', border: '1px solid #0ea5e9' }}>
              <h3 style={{ color: '#0c4a6e', marginBottom: '12px' }}>üí∞ Wallet Balance</h3>
              <div style={{ fontSize: '2rem', fontWeight: 'bold', color: '#0c4a6e' }}>
                ‚Çπ{user?.walletBalance || 0}
              </div>
              <button 
                className="btn btn-primary mt-4"
                onClick={() => navigate('/wallet')}
              >
                Manage Wallet
              </button>
            </div>

            <div className="card" style={{ background: '#f0fdf4', border: '1px solid #10b981' }}>
              <h3 style={{ color: '#065f46', marginBottom: '12px' }}>‚òÇÔ∏è Quick Rent</h3>
              <p style={{ color: '#065f46', marginBottom: '16px' }}>
                Find and rent an umbrella near you
              </p>
              <button 
                className="btn btn-success"
                onClick={() => navigate('/umbrellas')}
                disabled={needsDeposit}
              >
                Rent Umbrella
              </button>
            </div>
          </div>

          {activeRental && (
            <div className="card" style={{ background: '#fef3c7', border: '1px solid #f59e0b', marginTop: '20px' }}>
              <h3 style={{ color: '#92400e', marginBottom: '12px' }}>üîÑ Active Rental</h3>
              <p style={{ color: '#92400e' }}>
                Umbrella: {activeRental.umbrella?.umbrellaId} | 
                Started: {new Date(activeRental.startTime).toLocaleString()}
              </p>
              <button 
                className="btn btn-primary mt-4"
                onClick={() => navigate('/tracking')}
              >
                Track Umbrella
              </button>
            </div>
          )}

          <div className="card" style={{ marginTop: '20px' }}>
            <h3 style={{ marginBottom: '16px', color: '#1f2937' }}>üìã Recent Rentals</h3>
            {rentalHistory.length === 0 ? (
              <p style={{ color: '#6b7280', textAlign: 'center', padding: '20px' }}>
                No rental history yet. Start by renting your first umbrella!
              </p>
            ) : (
              <div style={{ maxHeight: '300px', overflowY: 'auto' }}>
                {rentalHistory.slice(0, 5).map((rental) => (
                  <div key={rental._id} style={{ 
                    padding: '12px', 
                    border: '1px solid #e5e7eb', 
                    borderRadius: '8px', 
                    marginBottom: '8px',
                    display: 'flex',
                    justifyContent: 'space-between',
                    alignItems: 'center'
                  }}>
                    <div>
                      <strong>{rental.umbrella?.umbrellaId}</strong>
                      <div style={{ fontSize: '0.875rem', color: '#6b7280' }}>
                        {new Date(rental.startTime).toLocaleDateString()}
                      </div>
                    </div>
                    <div style={{ textAlign: 'right' }}>
                      <div style={{ fontWeight: 'bold' }}>‚Çπ{rental.totalAmount}</div>
                      <div style={{ fontSize: '0.875rem', color: '#6b7280' }}>
                        {rental.duration}h
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
